syntax = "proto2";

package v3.fingerprint.domain_name.service.library;

message Message {
  optional string name = 1;
  optional uint32 port = 2;
  optional string schema = 3;
  optional string library_name = 4;
  optional string library_version = 5;
  optional string library_type = 6;
  optional string detail = 7;
}
